INSERT INTO `dashb_panel_html_i18n` VALUES (57,'de','<h1>Externe Verbindungen</h1>'),(57,'en','<h1>External Connections</h1>'),(57,'es','<h1>Conexiones externas</h1>'),(57,'fr','<h1>Connections externes</h1>'),(57,'ja','<h1>å¤–éƒ¨æ¥ç¶š</h1>'),(57,'pt','<h1>ConexÃµes Externas</h1>'),(57,'zh','<h1>å¤–éƒ¨è¿æ¥</h1>'),(66,'de','<h1>Willkommen zum JBoss-Dashboard Generator</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />JBoss Dashboard Generator ist ein Open Source Dashboard- und Berichts-Tool, das gestattet:</p>\n<p>&nbsp;</p>\n<ul>\n    <li>Visuelle Konfiguration und Personalisierung von Dashboards.</li>\n    <li>Grafische Darstellung von KPIs (Key Performance Indicators).</li>\n    <li>Definition vom interaktiven Berichte Tabellen.</li>\n    <li>Filtern und Suchen, entweder im Speicher oder auf Datenbank-Basis.</li>\n</ul>\n<ul>\n    <li>Verarbeiten AusfÃ¼hrungs-Metriken Dashboards.</li>\n    <li>Datensammlung aus externen Systemen Ã¼ber unterschiedliche Protokolle.</li>\n    <li>Zugriffskontrolle fÃ¼r verschiedene Benutzerprofile auf verschiedenen Ebenen der Information.</li>\n</ul>\n<br />\n<br />\n<h2>ZukÃ¼nftige Eigenschaften</h2>\n&nbsp;\n<ul>\n    <li>Weitere Diagrammtypen</li>\n    <li>UnterstÃ¼tzung fÃ¼r mehrere Datenreihen.</li>\n    <li><span style=\"font-size: 9pt;\">Kompletter Import und Export von Dashboards.</span></li>\n    <li>Neue Verbindungen zu NoSQL Datenbanken.</li>\n    <li>Echtzeit DatenstrÃ¶me UnterstÃ¼tzung..</li>\n    <li>Prognosemodelle.</li>\n</ul>'),(66,'en','<h1>Welcome to JBoss Dashboard Builder</h1>\r\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />JBoss Dashboard Builder is an open source dashboard and reporting tool that allows:</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n    <li>Visual configuration and personalization of dashboards.</li>\r\n    <li>Graphical representation of KPIs (Key Performance Indicators).</li>\r\n    <li>Definition of interactive report tables.</li>\r\n    <li>Filtering and search, both in-memory or database based.</li>\r\n</ul>\r\n<ul>\r\n    <li>Process execution metrics dashboards.</li>\r\n    <li>Data extraction from external systems, through different protocols.</li>\r\n    <li>Access control for different user profiles to different levels of information.</li>\r\n</ul>\r\n<br />\r\n<br />\r\n<h2>Upcoming features</h2>\r\n&nbsp;\r\n<ul>\r\n    <li>Additional chart types.</li>\r\n    <li>Support for multiple data series.</li>\r\n    <li><span style=\"font-size: 9pt;\">Complete import and export of dashboards.</span></li>\r\n    <li>New connectors to NoSQL databases.</li>\r\n    <li>Real-time data feeds support.</li>\r\n    <li>Predictive models.</li>\r\n</ul>'),(66,'es','<h1>Bienvenido a JBoss Dashboard Builder</h1>\r\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" /></p>\r\n<p>JBoss Dashboard Builder&nbsp;es una herramiento de c&oacute;digo abierto para realizar cuadros de mando e informes que permite:<br />\r\n&nbsp;</p>\r\n<ul>\r\n    <li>Configuraci&oacute;n visual y personalizaci&oacute;n de cuadros de mando.</li>\r\n    <li>Representaci&oacute;n gr&aacute;fica de KPIs (indicadores clave de rendimiento).</li>\r\n    <li>Definici&oacute;n de tablas de informe interactivas.</li>\r\n    <li>Filtrado y b&uacute;squeda, tanto en memoria como en base de datos.</li>\r\n</ul>\r\n<ul>\r\n    <li>Cuadros de mando de m&eacute;tricas de ejecuci&oacute;n de procesos.</li>\r\n    <li>Extracci&oacute;n de datos de sistemas externos, a trav&eacute;s de distintos protocolos.</li>\r\n    <li>Control de acceso a los diferentes niveles de informaci&oacute;n para diferentes perfiles de usuario.</li>\r\n</ul>\r\n<br />\r\n<br />\r\n<h2><br />\r\nPr&oacute;ximas funcionalidades:</h2>\r\n&nbsp;\r\n<ul>\r\n    <li>Soporte para m&uacute;ltiples series de datos.</li>\r\n    <li>Nuevos tipos de gr&aacute;ficas.</li>\r\n    <li><span style=\"font-size: 9pt;\">Completa exportaci&oacute;n e importaci&oacute;n de cuadros de mando.</span></li>\r\n    <li>Nuevos conectores a bases de datos NoSQL.</li>\r\n    <li>Datos en tiempo real.</li>\r\n    <li>Modelos predictivos.</li>\r\n</ul>'),(66,'fr','<h1>Bienvenue dans JBoss Dashboard Builder</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"images/home-image.jpg\" style=\"float: right;\" />JBoss Dashboard Builder est un tableau de bord et un outil de gÃ©nÃ©ration de rapports qui vous permet :</p>\n<p>&nbsp;</p>\n<ul>\n    <li>La visualisation et la personnalisation des tableaux de bord.</li>\n    <li>La reprÃ©sentation graphique des KPI (Indicateurs clÃ©s de performance).</li>\n    <li>DÃ©finition de tableaux de rapports interactifs.</li>\n    <li>Filtrage et recherche, tous deux basÃ©s mÃ©moire ou base de donnÃ©es.</li>\n</ul>\n<ul>\n    <li>Tableaux de bord de mÃ©triques d\'exÃ©cution de processus.</li>\n    <li>Extraction des donnÃ©es de systÃ¨mes externes, par des protocoles divers.</li>\n    <li>ContrÃ´le de l\'accÃ¨s par diffÃ©rents profils d\'utilisateurs vers diffÃ©rents niveaux d\'information.</li>\n</ul>\n<br />\n<br />\n<h2>CaractÃ©ristiques de produits Ã  venir</h2>\n&nbsp;\n<ul>\n    <li>Types de diagrammes supplÃ©mentaires.</li>\n    <li>Support des sÃ©ries de donnÃ©es multiples.</li>\n<li><span style=\"font-size: 9pt;\">Import et export complet de tableaux de bord.</span></li>\n    <li>Nouveaux connecteurs vers bases de donnÃ©es NoSQL.</li>\n     <li>Support des flux de donnÃ©es en temps rÃ©el.</li>\n    <li>ModÃ¨les de prÃ©diction.</li>\n</ul>'),(66,'ja','<h1>JBoss ãƒ€ãƒƒã‚·ãƒ¥ãƒœãƒ¼ãƒ‰ãƒ“ãƒ«ãƒ€ãƒ¼</h1>\n<p><img width=\"570\" height=\"425\" title=\"JBoss Dashboard Builder\" alt=\"JBoss Dashboard Builder\" src=\"i